import Header from '../comps/Header';
import {css, cx} from 'emotion';

const layoutStyle = {
    margin: 20,
    margin: 20,
    border: '1px solid #DDD'
};

const Layout = props => (
    <div style={layoutStyle}>
        <Header />
        {props.children}
    </div>
)

export default Layout;
